import React from 'react';
import ReactFlow, {
  ReactFlowProvider,
  addEdge,
  MiniMap,
  Controls,
  Background,
  Connection,
  Edge,
  Node,
  applyEdgeChanges,
  applyNodeChanges,
} from 'reactflow';
import 'reactflow/dist/style.css';

const initialNodes: Node[] = [
  { id: '1', type: 'input', data: { label: 'Input Node' }, position: { x: 250, y: 0 } },
  { id: '2', data: { label: 'Default Node' }, position: { x: 100, y: 100 } },
  { id: '3', data: { label: 'Output Node' }, position: { x: 400, y: 100 } },
];

const initialEdges: Edge[] = [
  { id: 'e1-2', source: '1', target: '2', animated: true },
  { id: 'e2-3', source: '2', target: '3' }
];

const Fluxograma: React.FC = () => {
  const [nodes, setNodes] = React.useState<Node[]>(initialNodes);
  const [edges, setEdges] = React.useState<Edge[]>(initialEdges);
  const [nodeId, setNodeId] = React.useState<number>(4); 
  const [processName, setProcessName] = React.useState<string>(''); 

  const onNodesChange = (changes: any) => setNodes((nds) => applyNodeChanges(changes, nds));
  const onEdgesChange = (changes: any) => setEdges((eds) => applyEdgeChanges(changes, eds));
  const onConnect = (connection: Edge | Connection) => setEdges((eds) => addEdge(connection, eds));

  const addNode = () => {
    if (!processName) {
      alert('Por favor, insira um nome para o processo.');
      return;
    }

    const newNode: Node = {
      id: `${nodeId}`,
      data: { label: `Node ${nodeId}` },
      position: { x: Math.random() * 500, y: Math.random() * 500 },
    };
    setNodes((nds) => nds.concat(newNode));
    setNodeId((id) => id + 1);
    setProcessName(''); 
  };

  const removeNode = () => {
    setNodes((nds) => nds.slice(0, -1));
  };

  return (
    <div className="flex flex-col justify-center items-center h-3/4 w-3/4 bg-gray-100 m-auto">
      <h2 className='text-lg font-bold text-gray-900'>
        TIMELINE
      </h2>
      <div className="w-full h-full">
        <ReactFlowProvider>
          <ReactFlow
            nodes={nodes}
            edges={edges}
            onNodesChange={onNodesChange}
            onEdgesChange={onEdgesChange}
            onConnect={onConnect}
            style={{ width: '100%', height: '90vh' }}
          >
            <MiniMap />
            <Controls />
            <Background />
          </ReactFlow>
        </ReactFlowProvider>
      </div>
      <div className="flex w-full justify-center py-4 bg-white">
        <input
          type="text"
          value={processName}
          onChange={(e) => setProcessName(e.target.value)}
          placeholder="Nome do processo"
          className="mr-2 px-4 py-2 border border-gray-300 rounded text-sm focus:border-blue-950"
        />
        <button
          onClick={addNode}
          className="mr-2 px-4 py-0 h-10 bg-gray-800 text-white rounded font-bold text-xs"
        >
          <svg fill="#fff" version="1.1" id="Capa_1" xmlns="http://www.w3.org/2000/svg" 
            width="14px" height="14px" viewBox="0 0 45.402 45.402">
            <g>
              <path d="M41.267,18.557H26.832V4.134C26.832,1.851,24.99,0,22.707,0c-2.283,0-4.124,1.851-4.124,4.135v14.432H4.141
                c-2.283,0-4.139,1.851-4.138,4.135c-0.001,1.141,0.46,2.187,1.207,2.934c0.748,0.749,1.78,1.222,2.92,1.222h14.453V41.27
                c0,1.142,0.453,2.176,1.201,2.922c0.748,0.748,1.777,1.211,2.919,1.211c2.282,0,4.129-1.851,4.129-4.133V26.857h14.435
                c2.283,0,4.134-1.867,4.133-4.15C45.399,20.425,43.548,18.557,41.267,18.557z"/>
            </g>
          </svg>
        </button>
        <button
          onClick={removeNode}
          className="px-4 py-0 h-10 bg-gray-900 text-white rounded font-bold text-xs"
        >
          <svg fill="#fff" version="1.1" id="Capa_1" xmlns="http://www.w3.org/2000/svg" width="12px" height="12px" viewBox="0 0 41.756 41.756">
            <g>
              <path d="M27.948,20.878L40.291,8.536c1.953-1.953,1.953-5.119,0-7.071c-1.951-1.952-5.119-1.952-7.07,0L20.878,13.809L8.535,1.465
                c-1.951-1.952-5.119-1.952-7.07,0c-1.953,1.953-1.953,5.119,0,7.071l12.342,12.342L1.465,33.22c-1.953,1.953-1.953,5.119,0,7.071
                C2.44,41.268,3.721,41.755,5,41.755c1.278,0,2.56-0.487,3.535-1.464l12.343-12.342l12.343,12.343
                c0.976,0.977,2.256,1.464,3.535,1.464s2.56-0.487,3.535-1.464c1.953-1.953,1.953-5.119,0-7.071L27.948,20.878z"/>
            </g>
          </svg>
        </button>
      </div>

    </div>
  );
};

export default Fluxograma;
